import Nav from "../components/Nav";

const Home = () => {
  const authToken = true;
  const handleClick = () => {
    console.log("clicked");
  };
  return (
    <>
      <Nav />
      <div className="home">
        <h1>Home</h1>
        <button className="primary-btn" onClick={handleClick}>
          {authToken ? "signout" : "Create Account"}
        </button>
      </div>
    </>
  );
};

export default Home;
